import React from 'react'
import { Header } from './components/header/Header';
import { SectionImg } from './components/sectionimg/SectionImg';
import data from './data/data'


function App() {
  return (
    <React.Fragment>
      <Header/>
      <SectionImg img="https://cms-images.mmst.eu/2rj3gcd43pmw/X1s76hIAACQAcE2X/7b1ca0f17647631b0b498811510433c5/Prismic_LP_Visual_Energielabels_1257x703_Teaser_1.jpg?q=80" title="Alex" content="aa" />
    </React.Fragment>
  );
}

export default App;
